import React from "react"
import Particles from "react-particles-js";

function Secondary() {
  return (
    <div className="App">
      By Ankit Bansal
      <Particles
        params={{
          particles: {
            number: {
              value: 200,
              density: {
                enable: true,
                value_area: 1000,
              },
            },
          },
        }}
      />
    </div>
  );
}

export default Secondary;
